INSERT INTO `login_bonus_detail` VALUES (/*id*/35, /*login_bonus_id*/30000, /*count*/15, /*reward_type*/2, /*reward_id*/24001, /*reward_num*/1, /*character_id*/0, /*character_name*/"", /*description*/"", /*voice_id*/0, /*bg_id*/0);
INSERT INTO `login_bonus_detail` VALUES (/*id*/36, /*login_bonus_id*/40000, /*count*/1, /*reward_type*/8, /*reward_id*/91002, /*reward_num*/100, /*character_id*/0, /*character_name*/"", /*description*/"", /*voice_id*/0, /*bg_id*/0);
INSERT INTO `login_bonus_detail` VALUES (/*id*/37, /*login_bonus_id*/40001, /*count*/1, /*reward_type*/8, /*reward_id*/91002, /*reward_num*/150, /*character_id*/107501, /*character_name*/"ぺコリーヌ", /*description*/"今日は記念日、お祝いですね！\n焼肉、お寿司、ピザ、ケーキ～☆\nあなたとパーティできるなんて、\n幸せです～♪", /*voice_id*/1, /*bg_id*/0);
INSERT INTO `login_bonus_detail` VALUES (/*id*/38, /*login_bonus_id*/40001, /*count*/2, /*reward_type*/8, /*reward_id*/91002, /*reward_num*/150, /*character_id*/107601, /*character_name*/"コッコロ", /*description*/"この記念日を迎えられたのは、\n主さまの器量の賜物\nさすがは主さまでございます\nえらい、えらい♪", /*voice_id*/1, /*bg_id*/0);
INSERT INTO `login_bonus_detail` VALUES (/*id*/39, /*login_bonus_id*/40001, /*count*/3, /*reward_type*/8, /*reward_id*/91002, /*reward_num*/150, /*character_id*/107801, /*character_name*/"キャル", /*description*/"あんたもけっこうやるじゃない！\nちょっとは…割と…け、けっこう\n見直しちゃったわ\n褒めてあげる♪", /*voice_id*/1, /*bg_id*/0);
INSERT INTO `login_bonus_detail` VALUES (/*id*/40, /*login_bonus_id*/40001, /*count*/4, /*reward_type*/8, /*reward_id*/91002, /*reward_num*/150, /*character_id*/107701, /*character_name*/"スズメ", /*description*/"あなたと私にとって、\n今日は特別な日\nあなたの支えがあるから、\n私は頑張れるんです！", /*voice_id*/1, /*bg_id*/0);
INSERT INTO `login_bonus_detail` VALUES (/*id*/41, /*login_bonus_id*/40001, /*count*/5, /*reward_type*/8, /*reward_id*/91002, /*reward_num*/150, /*character_id*/107901, /*character_name*/"タマキ", /*description*/"今日はキミにとっての\n特別な記念日だにゃ\nキミの活躍にはいつも\n猫ながら感謝してるにゃ～♪", /*voice_id*/1, /*bg_id*/0);
INSERT INTO `login_bonus_detail` VALUES (/*id*/42, /*login_bonus_id*/40001, /*count*/6, /*reward_type*/8, /*reward_id*/91002, /*reward_num*/150, /*character_id*/107501, /*character_name*/"ぺコリーヌ", /*description*/"う～かき氷食べ過ぎて、\n身体が冷えちゃいました…\nあなたの体温で温めてください！\nギューーッ♪", /*voice_id*/2, /*bg_id*/0);
INSERT INTO `login_bonus_detail` VALUES (/*id*/43, /*login_bonus_id*/40001, /*count*/7, /*reward_type*/8, /*reward_id*/91002, /*reward_num*/150, /*character_id*/107601, /*character_name*/"コッコロ", /*description*/"夏は危険がいっぱいと申します…\nですが、わたくしが主さまを\nしっかりとお守りいたしますよ", /*voice_id*/2, /*bg_id*/0);
INSERT INTO `login_bonus_detail` VALUES (/*id*/44, /*login_bonus_id*/40001, /*count*/8, /*reward_type*/8, /*reward_id*/91002, /*reward_num*/150, /*character_id*/107801, /*character_name*/"キャル", /*description*/"ん～なんであんたと、ひと夏を\n過ごすことになったのかな…\n結構楽しいからいいけど！\nさ、まだまだ遊ぶわよ！", /*voice_id*/2, /*bg_id*/0);
INSERT INTO `login_bonus_detail` VALUES (/*id*/45, /*login_bonus_id*/40001, /*count*/9, /*reward_type*/8, /*reward_id*/91002, /*reward_num*/150, /*character_id*/107701, /*character_name*/"スズメ", /*description*/"あなたと過ごすはじめての夏…\nいまからドキドキが止まりません\n楽しくて素敵な思い出が、\nまた一つ増えるんですね♪", /*voice_id*/2, /*bg_id*/0);
INSERT INTO `login_bonus_detail` VALUES (/*id*/46, /*login_bonus_id*/40001, /*count*/10, /*reward_type*/8, /*reward_id*/91002, /*reward_num*/150, /*character_id*/107901, /*character_name*/"タマキ", /*description*/"夏は一番の稼ぎ時にゃのに、\n今年はキミと過ごしたいって\n思ってるにゃ楽しい思い出\n増やしてくれるかにゃ？", /*voice_id*/2, /*bg_id*/0);
INSERT INTO `login_bonus_detail` VALUES (/*id*/57, /*login_bonus_id*/40003, /*count*/1, /*reward_type*/8, /*reward_id*/91002, /*reward_num*/150, /*character_id*/0, /*character_name*/"", /*description*/"", /*voice_id*/0, /*bg_id*/0);
